const ADD_MESSAGE = 'ADD-MESSAGE';

type DialogType = {
    id: number,
    name: string,
    avatar: string
}

type DialogListType = {
    _dialogs: Array<DialogType>,
    getDialogs: () => Array<DialogType>
}

let dialogs: Array<DialogType> = [
    { id: 1, name: 'Dima', avatar: 'data:image/jpeg;base64,' },
    { id: 2, name: 'Kima', avatar: 'data:image/jpeg;base64,' },
    { id: 3, name: 'Zima', avatar: 'data:image/jpeg;base64,' },
    { id: 4, name: 'Fima', avatar: 'data:image/jpeg;base64,' },
    { id: 5, name: 'Lima', avatar: 'data:image/jpeg;base64,' },
    { id: 6, name: 'Bima', avatar: 'data:image/jpeg;base64,' }
];

let dialogList: DialogListType = {
    _dialogs: dialogs,
    getDialogs() {
        return this._dialogs;
    }
}


let messages = [
    { id: 1, content: 'Hi', myMessage: true },
    { id: 2, content: 'How are your IT?', myMessage: false },
    { id: 3, content: 'Yo', myMessage: true }
];

export type MessageType = {
    id: number,
    content: string,
    myMessage: boolean
}

type MessagesModuleType = {
    dialogs: DialogListType,
    messages: Array<MessageType>
};

let initialState: MessagesModuleType = {
    dialogs: dialogList,
    messages: messages
}

export const messageReducer = (state: MessagesModuleType = initialState, action: any): MessagesModuleType => {

    switch (action.type) {
        case ADD_MESSAGE:
            return {
                ...state,
                messages: [...state.messages, { id: 1, content: action.payload, myMessage: true }]
            };
        default:
            return state;
    }
}

type AddMessageActionType = {
    type: typeof ADD_MESSAGE,
    payload: string
}

const addMessageAction = (newMessageText: string): AddMessageActionType => ({ type: ADD_MESSAGE, payload: newMessageText });

export const addNewMessage = (newMessageText: string) => {

    return (dispatch: any) => {
        console.log(newMessageText)
        dispatch(addMessageAction(newMessageText));
    };
}
